INSERT INTO `p8_cms_category` (`id`,`parent`,`name`,`letter`,`model`,`url`,`domain`,`frame`,`type`,`item_count`,`htmlize`,`html_list_url_rule`,`html_list_url_rule_mobile`,`html_view_url_rule`,`html_view_url_rule_mobile`,`path`,`page_size`,`list_template`,`list_template_mobile`,`view_template`,`view_template_mobile`,`item_template`,`item_template_mobile`,`display_order`,`seo_keywords`,`seo_description`,`label_postfix`,`need_password`,`category_password`,`list_all_model`,`config`) VALUES ('970','852','血液内科','x','article','','','/attachment/cms/category/2021_07/15_09/ef3b91615f6cdf8c.jpg.thumb.jpg','2','1','1','{$core_url}/html/{$id}/#list-{$page}.html#','{$core_m_url}/{$id}/#list-{$page}.html#','{$core_url}/html/{$cid}/{$Y}-{$m}-{$d}/content-{$id}#-{$page}#.html','{$core_m_url}/{$cid}/{$Y}-{$m}-{$d}/content-{$id}#-{$page}#.html','keshidaohang/linchuangkeshi/xueyeneike','30','article/big_list_keshi2','article/list_mobile','article/view_copy14','article/view_mobile','common/ico_title/list016','mobile/list','0','','','category_970','0','','0','a:22:{s:21:\"direct_to_category_id\";i:0;s:6:\"target\";s:6:\"_blank\";s:9:\"post_year\";i:0;s:12:\"post_quarter\";i:0;s:10:\"post_month\";i:0;s:9:\"post_week\";i:0;s:11:\"enable_show\";i:0;s:7:\"orderby\";s:5:\"level\";s:12:\"orderby_desc\";i:0;s:17:\"list_title_length\";i:120;s:24:\"list_title_length_mobile\";i:40;s:21:\"list_title_length_dot\";s:1:\"0\";s:28:\"list_title_length_mobile_dot\";s:1:\"0\";s:19:\"list_pages_template\";s:0:\"\";s:26:\"list_pages_template_mobile\";s:20:\"page_template_mobile\";s:19:\"view_pages_template\";s:18:\"base_page_template\";s:7:\"summary\";s:631:\"<p>盐城市第一人民医院血液内科创建于1985年，是国家药物临床试验专业基地、住院医师规培基地、非亲缘造血干细胞移植资质单位，是盐城市重点临床专科和医学重点学科，2018年被评为江苏省临床重点专科。</p>\r\n<p>科室现开放床位126张，设有2个病区。拥有百级层流病房3间、独立的血液病实验室，配备流式细胞仪、血细胞分离机、荧光定量PCR仪等一批先进的医疗设备。年出院人次3000余人，年门诊人次9000余人。全科共有医师20人，其中高级职称10人，博士3人，硕士11人...</p>\r\n\";s:7:\"linkurl\";s:38:\"/html/970/2021-07-14/content-2260.html\";s:10:\"need_login\";i:0;s:8:\"allow_ip\";a:5:{s:7:\"enabled\";s:1:\"0\";s:9:\"collectip\";a:0:{}s:7:\"beginip\";s:0:\"\";s:5:\"endip\";s:0:\"\";s:9:\"ruleoutip\";a:0:{}}s:3:\"fee\";a:2:{s:6:\"credit\";i:0;s:11:\"credit_type\";i:0;}s:13:\"administrator\";a:0:{}}');
INSERT INTO `p8_cms_category` (`id`,`parent`,`name`,`letter`,`model`,`url`,`domain`,`frame`,`type`,`item_count`,`htmlize`,`html_list_url_rule`,`html_list_url_rule_mobile`,`html_view_url_rule`,`html_view_url_rule_mobile`,`path`,`page_size`,`list_template`,`list_template_mobile`,`view_template`,`view_template_mobile`,`item_template`,`item_template_mobile`,`display_order`,`seo_keywords`,`seo_description`,`label_postfix`,`need_password`,`category_password`,`list_all_model`,`config`) VALUES ('971','852','风湿免疫科','f','article','','','/attachment/cms/category/2021_07/15_09/14008beb974a8da1.jpg.thumb.jpg','2','1','1','{$core_url}/html/{$id}/#list-{$page}.html#','{$core_m_url}/{$id}/#list-{$page}.html#','{$core_url}/html/{$cid}/{$Y}-{$m}-{$d}/content-{$id}#-{$page}#.html','{$core_m_url}/{$cid}/{$Y}-{$m}-{$d}/content-{$id}#-{$page}#.html','keshidaohang/linchuangkeshi/fengshimianyike','30','article/big_list_keshi2','article/list_mobile','article/view_copy14','article/view_mobile','common/ico_title/list016','mobile/list','0','','','category_971','0','','0','a:22:{s:21:\"direct_to_category_id\";i:0;s:6:\"target\";s:6:\"_blank\";s:9:\"post_year\";i:0;s:12:\"post_quarter\";i:0;s:10:\"post_month\";i:0;s:9:\"post_week\";i:0;s:11:\"enable_show\";i:0;s:7:\"orderby\";s:5:\"level\";s:12:\"orderby_desc\";i:0;s:17:\"list_title_length\";i:120;s:24:\"list_title_length_mobile\";i:40;s:21:\"list_title_length_dot\";s:1:\"0\";s:28:\"list_title_length_mobile_dot\";s:1:\"0\";s:19:\"list_pages_template\";s:0:\"\";s:26:\"list_pages_template_mobile\";s:20:\"page_template_mobile\";s:19:\"view_pages_template\";s:18:\"base_page_template\";s:7:\"summary\";s:770:\"<p>盐城市第一人民医院风湿免疫科创建于2008年，是盐城市首个建立的风湿免疫专科的医院。目前已建成为盐城市住院医师规范化培训基地，南通大学医学院、徐州医学院本科班临床课教学及硕士研究生培养基地。2014年顺利通过国家药物临床试验机构的评审。</p>\r\n<p>科室现拥有床位数38张，医生14人（其中10人为硕士研究生），护士9人。依托医院良好的医疗、教学以及科研平台，在市卫健委以及院领导的大力支持和全科人员的不懈努力下，年出院病人平均1000例，每年...门诊量平均10000人次。具有诊治风湿免疫常见病如各种关节炎、口腔溃疡，肌炎、血管炎、红斑狼疮及疑难</p>\r\n\r\n\";s:7:\"linkurl\";s:38:\"/html/971/2021-07-14/content-2261.html\";s:10:\"need_login\";i:0;s:8:\"allow_ip\";a:5:{s:7:\"enabled\";s:1:\"0\";s:9:\"collectip\";a:0:{}s:7:\"beginip\";s:0:\"\";s:5:\"endip\";s:0:\"\";s:9:\"ruleoutip\";a:0:{}}s:3:\"fee\";a:2:{s:6:\"credit\";i:0;s:11:\"credit_type\";i:0;}s:13:\"administrator\";a:0:{}}');
