gin\";i:0;s:8:\"allow_ip\";a:5:{s:7:\"enabled\";s:1:\"0\";s:9:\"collectip\";a:0:{}s:7:\"beginip\";s:0:\"\";s:5:\"endip\";s:0:\"\";s:9:\"ruleoutip\";a:0:{}}s:3:\"fee\";a:2:{s:6:\"credit\";i:0;s:11:\"credit_type\";i:0;}s:13:\"administrator\";a:0:{}}');
INSERT INTO `p8_cms_category` (`id`,`parent`,`name`,`letter`,`model`,`url`,`domain`,`frame`,`type`,`item_count`,`htmlize`,`html_list_url_rule`,`html_list_url_rule_mobile`,`html_view_url_rule`,`html_view_url_rule_mobile`,`path`,`page_size`,`list_template`,`list_template_mobile`,`view_template`,`view_template_mobile`,`item_template`,`item_template_mobile`,`display_order`,`seo_keywords`,`seo_description`,`label_postfix`,`need_password`,`category_password`,`list_all_model`,`config`) VALUES ('985','852','心胸外科','x','article','','','<!--#p8_attach#-->/cms/category/2021_10/18_15/af96824301aaf2af.jpg','2','1','1','{$core_url}/html/{$id}/#list-{$page}.html#','{$core_m_url}/{$id}/#list-{$page}.html#','{$core_url}/html/{$cid}/{$Y}-{$m}-{$d}/content-{$id}#-{$page}#.html','{$core_m_url}/{$cid}/{$Y}-{$m}-{$d}/content-{$id}#-{$page}#.html','keshidaohang/linchuangkeshi/xinxiongwaike','30','article/big_list_keshi2','article/list_mobile','article/view_copy14','article/view_mobile','common/ico_title/list016','mobile/list','0','','','category_985','0','','0','a:24:{s:21:\"direct_to_category_id\";i:0;s:6:\"target\";s:6:\"_blank\";s:9:\"post_year\";i:0;s:12:\"post_quarter\";i:0;s:10:\"post_month\";i:0;s:9:\"post_week\";i:0;s:11:\"enable_show\";i:0;s:7:\"orderby\";s:5:\"level\";s:12:\"orderby_desc\";i:0;s:17:\"list_title_length\";i:120;s:24:\"list_title_length_mobile\";i:40;s:21:\"list_title_length_dot\";s:1:\"0\";s:28:\"list_title_length_mobile_dot\";s:1:\"0\";s:19:\"list_pages_template\";s:0:\"\";s:26:\"list_pages_template_mobile\";s:20:\"page_template_mobile\";s:19:\"view_pages_template\";s:18:\"base_page_template\";s:10:\"navigation\";s:0:\"\";s:7:\"summary\";s:654:\"<p>盐城市第一人民医院心胸外科创建于1976年。科室年开展普胸手术1000余例，手术切除率>98%，术后并发症<4%，胸吻合口瘘<0.3%，5年生存率>45%，达全省领先水平，在省内外拥有较高的知名度。</p>\r\n<p>目前科室设有3个病区，实际开放床位160张。设有主任医师6名、副主任医师2名、主治医师6名、住院医师7名，其中硕士14名。病房配有手提式心脏除颤仪、HNB注射泵、心脏临时起搏器、PB840呼吸机、便携式血气系列化分析仪、多功能心电监护仪、手掌式血糖测定仪、彩色心电监护仪等先进设备...</p>\r\n\r\n\";s:9:\"copyright\";s:0:\"\";s:7:\"linkurl\";s:38:\"/ht